CREATE DEFINER=`maestro_jacuestaf`@`%` FUNCTION `CREATE_USER`(_CEDULA VARCHAR (13)) RETURNS int(11)
BEGIN
DECLARE _CEDULA_ VARCHAR (13);
DECLARE _PASSWORD VARCHAR (200);
DECLARE _TYPE_USER INT;
SELECT USER INTO _CEDULA_ FROM maestro_db.USUARIOS WHERE USER = _CEDULA; 
IF _CEDULA_ = _CEDULA THEN
RETURN 2;
ELSE
SET _PASSWORD = MD5(_CEDULA);
SET _CEDULA_ = NULL;
SELECT CEDULA INTO _CEDULA_ FROM maestro_db.ALUMNOS WHERE CEDULA = _CEDULA;
IF _CEDULA_ = _CEDULA THEN
SET _TYPE_USER = 3;
ELSE
SET _CEDULA_ = NULL;
SELECT CEDULA INTO _CEDULA_ FROM maestro_db.DOCENTES WHERE CEDULA = _CEDULA;
IF _CEDULA_ = _CEDULA THEN
SET _TYPE_USER = 2;
ELSE
SET _TYPE_USER = 1;
END IF;
END IF;
INSERT INTO maestro_db.USUARIOS (USER,PASSWORD,COD_USER)
VALUES (_CEDULA,_PASSWORD,_TYPE_USER);
RETURN 1;
END IF;
END ;;
DELIMITER ;


