CREATE DEFINER=`maestro_jacuestaf`@`%` PROCEDURE `CREATE_LECTIVO`()
BEGIN
DECLARE _ANIO1 INT;
DECLARE _ANIO2 INT;
DECLARE _COD_LECTIVO VARCHAR (20);

SELECT YEAR(NOW()) INTO _ANIO1 ;
SELECT YEAR(NOW()) + 1 INTO _ANIO2 ;
SET _COD_LECTIVO = CONCAT(_ANIO1,"/",_ANIO2);

INSERT INTO maestro_db.ANIO_LECTIVO (COD_LECTIVO) VALUES (_COD_LECTIVO);
END ;;
