DELIMITER ;;
CREATE DEFINER=`maestro_jacuestaf`@`%` PROCEDURE `MATRICULAS`(IN _CEDULA VARCHAR (13) , IN _COD_PARALELO VARCHAR (10))
BEGIN
DECLARE _PERSONA INT;
DECLARE _REPRESENTANTE VARCHAR (13);
DECLARE  REPRESENTANTE VARCHAR (13);
DECLARE _REPRESENTANTE__ INT;
DECLARE _ALUMNO INT;
DECLARE _MATRICULA INT;
DECLARE _USER INT;
SET autocommit = 0;
START TRANSACTION;

SELECT maestro_db.CREATE_PERSONAS(_CEDULA) INTO _PERSONA;

IF _PERSONA = 1 OR _PERSONA = 2 THEN
SELECT CEDULA_REPR INTO _REPRESENTANTE FROM maestro_db.ALUMNOS_PRE WHERE CEDULA = _CEDULA;
SELECT CEDULA INTO REPRESENTANTE FROM maestro_db.PERSONAS WHERE CEDULA = _REPRESENTANTE;
IF REPRESENTANTE <=> _REPRESENTANTE THEN
SET REPRESENTANTE = NULL;
ELSE
SELECT maestro_db.CREATE_PERSONAS (_REPRESENTANTE) INTO _REPRESENTANTE__;
END IF;
END IF;

SELECT maestro_db.CREATE_ALUMNOS(_CEDULA) INTO _ALUMNO;
SELECT maestro_db.CREATE_MATRICULAS(_CEDULA,_COD_PARALELO) INTO _MATRICULA;
SELECT maestro_db.CREATE_USER(_CEDULA) INTO _USER;

IF _PERSONA = 1 OR _PERSONA = 2 THEN
IF _ALUMNO = 1 OR _ALUMNO = 2  THEN
IF _MATRICULA = 1 OR _MATRICULA = 2 THEN
IF _USER = 1 OR _USER = 2 THEN
DELETE FROM maestro_db.MATRICULAS_PRE WHERE CEDULA_ALUMNO = _CEDULA;
DELETE FROM maestro_db.ALUMNOS_PRE WHERE CEDULA = _CEDULA;
DELETE FROM maestro_db.PERSONAS_PRE WHERE CEDULA = _CEDULA;
DELETE FROM maestro_db.PERSONAS_PRE WHERE CEDULA = _REPRESENTANTE;
COMMIT;
SET autocommit = 1;
ELSE
ROLLBACK;
END IF;
ELSE
ROLLBACK;
END IF;
ELSE
ROLLBACK;
END IF;
ELSE 
ROLLBACK;
END IF;
END ;;
DELIMITER ;



DELIMITER ;;
CREATE DEFINER=`maestro_jacuestaf`@`%` PROCEDURE `MATRICULAS_PRE`(IN _CEDULA VARCHAR (13),_FOTO VARCHAR (50),IN _NOMBRES VARCHAR(100),IN _APELLIDOS VARCHAR (100),
IN _FECHA DATE,IN _NACIONALIDAD VARCHAR (50), IN _DIRECCION VARCHAR (200),IN _TELEFONO VARCHAR (13), IN _CORREO VARCHAR (200), IN _OCUPACION VARCHAR (150),
IN _NIVEL_EDU VARCHAR (15), IN _WHATSAPP VARCHAR (13),IN _ANTECEDENTES TEXT, IN _VACUNA VARCHAR (1), IN _INSTITUCION VARCHAR (1),
IN _NOMBRE_INST VARCHAR (200), IN _COD_CURSO VARCHAR (10),
IN _CEDULA_R VARCHAR (13),_FOTO_R VARCHAR (50),IN _NOMBRES_R VARCHAR(100),IN _APELLIDOS_R VARCHAR (100),
IN _FECHA_R DATE,IN _NACIONALIDAD_R VARCHAR (50), IN _DIRECCION_R VARCHAR (200),IN _TELEFONO_R VARCHAR (13), IN _CORREO_R VARCHAR (200), IN _OCUPACION_R VARCHAR (150),
IN _NIVEL_EDU_R VARCHAR (15), IN _WHATSAPP_R VARCHAR (13))
BEGIN
DECLARE ALUMNO INT;
DECLARE REPRESENTANTE INT;
DECLARE MATRICULA INT;
DECLARE LECTIVO INT;
DECLARE COD_LECTIVO_ VARCHAR (20);
DECLARE CEDULA_REPRESENTANTE VARCHAR (13);
DECLARE ALUMNO_M VARCHAR (13);
SET autocommit = 0;
START TRANSACTION; -- Inicio una transaccion
-- COMMIT; -- INICIO UN COMMIT
SELECT maestro_db.CREATE_PERSONAS_PRE(_CEDULA,_FOTO,_NOMBRES,_APELLIDOS,_FECHA,_NACIONALIDAD,_DIRECCION,_TELEFONO,_CORREO,_OCUPACION,
_NIVEL_EDU,_WHATSAPP) INTO ALUMNO; -- inserto los datos del alumno en la tabla personas_pre

SELECT maestro_db.CREATE_PERSONAS_PRE(_CEDULA_R,_FOTO_R,_NOMBRES_R,_APELLIDOS_R,_FECHA_R,_NACIONALIDAD_R,_DIRECCION_R,_TELEFONO_R,_CORREO_R,_OCUPACION_R,
_NIVEL_EDU_R,_WHATSAPP_R) INTO REPRESENTANTE; -- inserto los datos del representante en la tabla personas_pre

IF ALUMNO = 1 OR ALUMNO = 2 AND REPRESENTANTE = 1 OR REPRESENTANTE = 2 THEN 
SELECT  maestro_db.CREATE_ALUMNOS_PRE(_CEDULA,_CEDULA_R,0,_ANTECEDENTES,_VACUNA,_INSTITUCION,_NOMBRE_INST) INTO ALUMNO_M;
IF ALUMNO_M = 1 OR ALUMNO = 2 THEN
SELECT MAX(ID) INTO LECTIVO FROM maestro_db.ANIO_LECTIVO;
SELECT COD_LECTIVO INTO COD_LECTIVO_ FROM maestro_db.ANIO_LECTIVO WHERE ID = LECTIVO;
SELECT maestro_db.CREATE_MATRICULAS_PRE(_CEDULA,_COD_CURSO,COD_LECTIVO_) INTO MATRICULA;
END IF; -- evaluo si se registro al alumno para generar la matricula
END IF ; -- evaluo si se registraron los datos o ya estaban registrados

IF ALUMNO = 1 AND REPRESENTANTE = 1 AND MATRICULA = 1 THEN
COMMIT;
ELSEIF ALUMNO = 2 AND REPRESENTANTE = 2 AND MATRICULA = 2 THEN
COMMIT;
ELSEIF ALUMNO = 0 OR REPRESENTANTE = 0 OR MATRICULA = 0 THEN
ROLLBACK;
END IF;
END ;;
DELIMITER ;